Defendant Quaasheem A Chambers in court with attorney Mary Garvin Guimont.  Defendant Quaasheem A Chambers in custody.  Lucy Kronforst appeared for the State of Wisconsin.  Sentencing proceeded.  Statements by the State, defense and defendant.   The Court imposed the following sentence:

Defendant's TOTAL LENGTH OF SENTENCE shall be 6 years.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for 3 years   with credit for 120 days time served.  Defendant shall serve 3 years on EXTENDED SUPERVISION.    The defendant IS eligible for the Challenge Incarceration Program, but not for the Wisconsin Substance Abuse Program.  The Court advised the defendant of his determinate sentence pursuant to statute and in accordance with Form CR-234.  Copy provided to defendant. 

 * Court ordered defendant to provide a DNA sample.
 * Court ordered defendant to pay the DNA surcharge, costs and disbursements from prison funds not to exceed 25%.  Balance to be paid while on extended supervision.

CONDITIONS OF EXTENDED SUPERVISION:
 - Undergo a mental health evaluation; follow thru with any treatment recommended, including any medication regimen and must stay on said regimen;
 - No controlled substances other than those legally prescribed for defendant by a duly licensed physcian for his mental or physicial needs; take as prescribed and only for as long as deemed medically reasonable and necessary;
 - No alcohol;
 - AODA assessment; treatment, if needed;
 - Urine screens;
 - No contact with Fannie M; Keenan G. or juvenile T.W.;
 - No contact with and keep separate from co-actor Terrence Bennett;
 - Obtain GED;
 - Seek and maintain employment;
 - Job and vocational training;
 - Parenting classes;
 - Cognitive thinking intervention counseling;
 - Pay balance remaining of the DNA surcharge, costs and disbursements; pay supervision fees.  Failure to pay would result in a civil judgment entered against defendant, which is non-dischargable in bankrutpcy.

Court set restitution at zero.

